def f(n, cur=[]):
    # 1と0からなる長さNの組み合わせを全2**n個出すジェネレータ
    if len(cur) == n:
        yield cur
    else:
        for i in range(2):
            _next = cur[:]
            _next.append(i)
            yield from f(n, _next)


