from itertools import product


def check(N, p, X):
    for i in range(N):
        if p[i] == 0:
            continue
        for j in range(N):
            if X[i][j] is not None and X[i][j] != p[j]:
                return False
    return True


def main():
    N = int(input())
    X = [[None] * N for _ in range(N)]
    for i in range(N):
        A = int(input())
        for j in range(A):
            x, y = map(int, input().split())
            X[i][x-1] = y
    ans = 0
    for p in product([0, 1], repeat=N):
        if check(N, p, X):
            ans = max(ans, sum(p))
    print(ans)


