def f(n, cur=[]):
    # 1と0からなる長さNの組み合わせを全2**n個出すジェネレータ
    if len(cur) == n:
        yield cur
    else:
        for i in range(2):
            _next = cur[:]
            _next.append(i)
            yield from f(n, _next)


def check(arr):
    for i in range(n):
        if arr[i] == 0:
            continue
        for x, y in syougen[i]:
            if arr[x] == 1 and y == 0:
                return False
            if arr[x] == 0 and y == 1:
                return False
    return True


ans = 0
for g in f(n):
    if check(g):
        ans = max(ans, sum(g))
print(ans)

