def solve(S, T):
    if S.find(T) >= 0:
        return 0

    for i in range(1, len(T)):
        head = T[:-i]
        tail = T[i:]

        head_idx = S.find(head)
        tail_idx = S.rfind(tail)

        if 0 <= head_idx <= len(S) - len(T):
            return i

        if tail_idx >= i:
            return i

    return len(T)


